addEventListener("load", (evt) => {
    // on home page, landscape, make header go to the right side
    var orientation =
        (screen.orientation || {}).type ||
        screen.mozOrientation ||
        screen.msOrientation;
    if (
        window.innerHeight < 600 &&
        window.innerWidth < 1000 &&
        orientation === "landscape-primary"
    ) {
        let isHomePage = document.getElementById("home-page") !== null;
        if (isHomePage) {
            document.querySelector(".wrapper-in").style.flexDirection = "row";
            document.querySelector("header").classList.add("sided");
            document.getElementById("home-page").style.width = "100%";
            document.querySelector(".header-logo img").src = "images/logo-only.png";
        }
    }

    // Make header fixed if page has a scrollbar
    function isOverflown(element) {
        return (
            element.scrollHeight > element.clientHeight ||
            element.scrollWidth > element.clientWidth
        );
    }

    let notHomePage = $("#home-page").length < 0;
    if (notHomePage && isOverflown(document.querySelector("html"))) {
        let header = document.querySelector("header");
        document.body.style.overflow = "initial";
        document.querySelector("body > .wrapper").style.overflow = "initial";
        header.style.position = "sticky";
        header.style.width = "100%";
        header.style.top = "0";
    }
});

