var textArea = document.querySelectorAll(".partners-text p"),
    maxText = 70;

let teaserLength = window.innerWidth > 1900 ? 110 : 50;
// For each one...
[].forEach.call(textArea, function(el) {
    var textAreaLength = el.innerHTML.length,
        teaserText = el.innerHTML.substr(0, teaserLength),
        fullText = el.innerHTML,
        showTeaser = false;

    // Check to see if this text length is more
    // than the max
    if (textAreaLength >= maxText) {
        // Set flag
        showTeaser = true;

        // Set teaser text
        el.innerHTML = teaserText;
        el.innerHTML += el.innerHTML + "...";

        // Button click event
        el.parentElement.parentElement.addEventListener("click", function() {
            if (showTeaser === true) {
                // Update flag
                showTeaser = false;

                // Update button text
                // this.innerHTML = 'Show Less';

                // Show full text
                el.innerHTML = fullText;
                // Re-append the button
            } else {
                // Update flag
                showTeaser = true;

                // Update button text
                // this.innerHTML = 'Show More';

                // Show teaser text
                el.innerHTML = teaserText;
                el.innerHTML += el.innerHTML + "...";

                // Re-append the button
            }
            return false;
        });
    } else {
        // Show full text
        el.innerHTML = fullText;
    }
});

