document.addEventListener("DOMContentLoaded", () => {
    // Remove leading slashes from image sources
    // Eg: //images/icons/partnership.svg => images/icons/partnership.svg
    document.querySelectorAll(".in-menu .icon").forEach((icon, _) => {
        let src = icon.getAttribute("src");
        if (src.startsWith("//")) {
            icon.setAttribute("src", src.substr(1));
        }
    });

    // Disable catalog href on mobile
    if (window.innerWidth < 1000) {
        $('a[href="/catalogs"]').click((evt) => evt.preventDefault());
        $('a[href="/download-center"]').click((evt) => evt.preventDefault());
    }
});

// nav menu header typo
document.querySelector('a[href="/production"]').textContent = "ПРОИЗВОДСТВО";

// replace + character in phone number
function replacePlusCharacter() {
    let phoneEl = document.querySelector(".call-number");
    let phoneNumber = document.createTextNode(phoneEl.textContent.substr(1));

    let plusEl = document.createElement("span");
    plusEl.textContent = "+";
    plusEl.classList.add("font-default");

    phoneEl.innerHTML = "";
    phoneEl.appendChild(plusEl);
    phoneEl.appendChild(phoneNumber);
}

replacePlusCharacter();

// remove cursor outer rim when hovering on phone
$(".header-phone").mouseenter(() => {
    $(".kursor").css("border", "none");
    $(".kursorChild").css("opacity", 0.3);
});

$(".header-phone").mouseleave(() => {
    $(".kursor").css("border", "");
    $(".kursorChild").css("opacity", 1);
});

// Preserve cursor location across page reloads
document.addEventListener("DOMContentLoaded", () => {
    document.querySelector(".kursor").classList.add("kursor--hidden");
    document.querySelector(".kursorChild").classList.add("kursorChild--hidden");
    document.body.addEventListener(
        "mousemove",
        (evt) => {
            let kursor = document.querySelector(".kursor");
            let kursorChild = document.querySelector(".kursorChild");
            kursor.classList.remove("kursor--hidden");
            kursorChild.classList.remove("kursorChild--hidden");
        }, { once: true }
    );
});